import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div className="simple">
          <ul>
              <li>CSS</li>
              <li>JS</li>
              <li>React</li>
              <li>HTML</li>
          </ul>
      </div>
  );
}

function header() {
    return (
        <div className="header">
            <button inputMode="tel">Кнопка</button>
        </div>
    )
}

export default App;
